/**
 * Get pre-mainnet data by name
 * @param name The name to lookup
 * @returns The pre-mainnet record or undefined if not found
 */
export function getPreMainnetData(name: string): PreMainnetRecord | undefined {
  return preMainnetDataLookup[name];
}

/**
 * Get all available names
 * @returns Array of all names in the lookup
 */
export function getAllPreMainnetNames(): string[] {
  return Object.keys(preMainnetDataLookup);
}
